Former @chicagobears and current @washingtonnfl tackle @charleslenojr72 believes work must be done to rebuild trust between law enforcement and local communities.

@inspirechange grant partner @metrofamchicago is tackling this challenge through ongoing work with the @chicagopolicedepartment to help bridge the gap between police and the districts they serve.

To learn more about the NFL's efforts to address barriers to opportunity and equality, visit NFL.com/InspireChange. #InspireChange

